/*
* Siga as instruções do console para que o algoritmo retorne a resposta desejada
* */
fun main() {
    val time = System.currentTimeMillis()
    testesTorresGSM()
    println("Terminado: ${System.currentTimeMillis() - time} milissegundos")
    println("\n\n============== Iniciando testes CNF ==============\n\n")
    testeCNF()
}

fun testesTorresGSM(){
    val listNumeroTorres = listOf<Int>(2, 3, 3, 4, 4, 4, 5, 5, 5, 5)
    val listPares = listOf<MutableList<Pair<Int,Int>>>(
            mutableListOf(1 to 2),
            mutableListOf(1 to 2, 1 to 3),
            mutableListOf(1 to 2, 1 to 3, 2 to 3),
            mutableListOf(1 to 2, 1 to 3, 1 to 4),
            mutableListOf(1 to 2, 1 to 3, 1 to 4, 2 to 3),
            mutableListOf(1 to 2, 1 to 3, 1 to 4, 2 to 3, 2 to 4, 3 to 4),
            mutableListOf(1 to 2, 1 to 3, 1 to 4, 2 to 3, 1 to 5),
            mutableListOf(1 to 2, 1 to 3, 1 to 4, 2 to 3, 2 to 4, 1 to 5, 4 to 5),
            mutableListOf(1 to 2, 1 to 3, 1 to 4, 2 to 3, 2 to 4, 1 to 5, 4 to 5),
            mutableListOf(1 to 2, 1 to 3, 1 to 4, 2 to 3, 2 to 4, 1 to 5, 4 to 5, 2 to 5, 3 to 5)
    )
    for (i in 0..9){
        println("Comparação ${i + 1}:\n")
        torreGSMSemEntrada(listNumeroTorres[i],listPares[i])
        torreGSMSemEntradaTableaux(listNumeroTorres[i],listPares[i])
        torreGSMSemEntradaDPLL(listNumeroTorres[i],listPares[i])
        println("\n")
    }
    /*
    * Média de execução de cada situação em milis(3 testes):
    *      Força Bruta      Tableaux    DPLL
    * 1:      23              5,7       2
    * 2:      10,3            3       0,3
    * 3:      7,3             4       0,3
    * 4:      27              6,3     0,3
    * 5:      20,3            5,3     0,6
    * 6:      13,3            27      1
    * 7:      76              7,7     1
    * 8:      70              7,3     2,3
    * 9:      68              11,3    3,3
    * 10:     84              70,3    3
    * */
}

